import React from 'react'

const Footer = () => {
    return (
        <>
            <div className="bg-black sticky w-full z-50 text-white text-center py-4 text-md -space-y-6">
                This project was built using react and tailwind css with fakeStore Api. <a href="iamnuru.github.io" className="text-red-600">Explore</a>{' '}
                some of my works. Please consider hiring me if you deem it fit :). Email via <span className="text-purple-800">abdulainurudeentitiaka@gmail.com</span>            
            </div>
        </>
    )
}

export default Footer
